import React from 'react';
import './App.css';
import Clock from './Clock'
import Calculator from './Calculator';
import jsonData from './testinfo.json';

const App = () => {
  return (
    <div className="app">
      <h1>React Calculator</h1>
      <Clock />
      <Calculator />
      <h1>Type: {jsonData.type}</h1>
      <h1>Question: {jsonData.question}</h1>
      <h1>Options: {jsonData.options}</h1>
      <h1>Answer: {jsonData.answer}</h1>

    </div>
  );
};

export default App;
